snippet.textDisplay:
@huhu300 Verdade a economia do Brasil não está bem.

Agora! Voltando a questão da vacina, que situação complica! A vacina ainda não está 100%, ainda tem pouco tempo de teste (Isso é fato), porém querem nos obrigar assim mesmo. Obrigados por uma imposição Legal ou sentimental ""Ser contra a vacina é ser cúmplice de qualquer um que possa morrer por causa do vírus".

E se algumas pessoas que não queriam tomar a vacina, mas foram forçadas, tiverem algum efeito colateral e morrerem! Neste caso, ser a favor da vacinação obrigatória é ser cúmplice da morte de qualquer um que possa vir pela vacina???

